export default class Exchange extends Component {
    render() {
        return (
            <div>
                <select id="currency-one">
                    <option value="USD">USD</option>
                    <option value="CNY">CNY</option>
                </select>
                <input type="number" placeholder="0" />

            </div>
        )
    }
}
